    "2015-07-22T03:42:21.377167",nt"name": "ship-traffic-2011-west-coast-region-all-ship-types",nt"isopen":
    false,nt"url": null,nt"notes": "The data was derived from US Coast Guard
    raw vessel point returns and preprocessed by ASA (Applied Science Associates), to
    one minute point interCAls. The data returns are in UTM zone 10 North and UTM zone
    11 North. Each vessel type is analyzed seperately based on vessel type data (Cargo,
    Fishing, Passenger, Tanker, Tow, Tow over 200M, Tugs) included in the AIS dataset.
    A transit is counted for each unique vessel by MMSI traveling through each 1200
    meter by 1200 meter aliquot each day. A running count is continued for each vessel
    type by aliquot by month, and then the months are summed to provide annual data.
    </SPAN></P><P><SPAN>Although traffic diminishes significantly after 20nm from shore,
    the returns from line of site AIS signals also fade beyond 40nm. Data points input
    into the density analysis beyond 40nm are considered to be less reliable than closer
    to shore. For the 2011 data, separate vessel types were also extracted separately
    and run in addition to the full dataset. These separate counts are included in the
    attribute table and include Cargo Vessels, Fishing Vessels, Tankers, Passenger Ships,
    Tugs, Towing Vessels less than 200 meters in length, and Towing Vessels more than
    200 meters in length.",nt"license_title": null,nt"extras": [{ntt"key":
